import MyButton from "../Ui/customUi/MyButton";
import "./Breadcrumbnavigation.css";

const BreadcrumbNavigation = () => {
  return (
    <div className="breadcrumb_navigation">
      <div className="breadcrumb_navigation_list">
        <MyButton className="breadcrumb_navigation_item">Home</MyButton>
        <MyButton className="breadcrumb_navigation_item">
          Auction Calendar
        </MyButton>
        <MyButton className="breadcrumb_navigation_item">
          Sale List for Georgia
        </MyButton>
        <MyButton className="breadcrumb_navigation_item">
          2014 - BMW 3er Touring
        </MyButton>
      </div>
      <div>
        <MyButton className={"button"}>Next</MyButton>
        <MyButton className="navigation" disabled>
          Previous
        </MyButton>
        <button className="navigation">Next</button>
      </div>
    </div>
  );
};

export default BreadcrumbNavigation;
